import './index.scss'
import dynamic from "next/dynamic";
const Animator = dynamic(
  import("react-scroll-motion").then((it) => it.Animator),
  { ssr: false }
);

import { batch, Fade, ScrollContainer, ScrollPage, Sticky, Zoom} from 'react-scroll-motion';

function SkillsCertificates(){
  return (
    <ScrollContainer>
      <ScrollPage page = {0}>
        <Animator animation = {batch(Sticky(), Fade())}>
          <h2>Let me show you a scroll animation</h2>
        </Animator>
      </ScrollPage>
      <ScrollPage page = {1}>
        <Animator animation = {Zoom()}>
          <h4>I'm Fade Up Scroll Out !</h4>
        </Animator>
      </ScrollPage>
    </ScrollContainer>
  );

}
export default SkillsCertificates;
